// src/components/UnreadNotificationsPrompt.js
import React from 'react';

const UnreadNotificationsPrompt = ({ notifications, onClose, onPostClick }) => {
  return (
    <div className="unread-notifications-prompt">
      <div className="prompt-content">
        <button className="close-btn" onClick={onClose}>Close</button>
        <h3>Unread Posts</h3>
        {notifications.length > 0 ? (
          notifications.map((notif) => (
            <div
              key={notif.postId}
              className="notification-item"
              onClick={() => onPostClick(notif.postId)}
            >
              <p>Posted by: {notif.authorUsername}</p>
            </div>
          ))
        ) : (
          <p>No unread posts</p>
        )}
      </div>
    </div>
  );
};

export default UnreadNotificationsPrompt;
